import AboutContent from "../components/about_components/AboutContent";
import Header from "../components/Header";
import Footer from "../components/Footer";
import sideBarImg from "../images/sidebarimg.jpeg";

const About = () => {
  const sideBarStyle = {
    backgroundImage: "url(" + sideBarImg + ")",
  };
  return (
    <>
      <section
        style={{ minHeight: "calc(100vh - 60px)" }}
        className="main-about-section "
      >
        <Header />
        <div className="about-content-area flex flex-col mt-4 md:mt-4 ml-5 mr-5 md:ml-10 md:mr-10 lg:mr-20 lg:ml-20 gap-4">
          <div
            className="backgroundSidebarImg w-full h-36 h-32 lg:w h-auto bg-cover lg:mb-8 rounded bg-center"
            style={sideBarStyle}
          ></div>
          <div className="main-about-content pt-4 pb-4 text-slate-50 bg-amber-600 rounded col-span-2 mb-4 lg:mb-8 row-span-1">
            <AboutContent />
          </div>
        </div>
      </section>
      <Footer />
    </>
  );
};

export default About;
